import React from "react";
import ProductCard from "./ProductCard";
import "./ProductList.css";

const ProductList = () => {
  const products = [
    {
      img: "img/tovar/Iphone 16 Pro.jpeg",
      model: "Смартфон Apple iPhone 14 128GB",
      oldPrice: "888",
      newPrice: "777",
      availability: "В наличии",
    },
    {
      img: "img/tovar/iphon12.jpg",
      model: "Смартфон Samsung Galaxy S23 256GB",
      oldPrice: "999",
      newPrice: "888",
      availability: "Нет в наличии",
    },
    {
      img: "img/tovar/iphone13.jpg",
      model: "Планшет Apple iPad Pro 128GB",
      newPrice: "59 999",
      availability: "В наличии",
    },
    {
      img: "img/tovar/iphone13.jpg",
      model: "Планшет Apple iPad Pro 128GB",
      newPrice: "59 999",
      availability: "В наличии",
    },
    {
      img: "img/tovar/iphone13.jpg",
      model: "Планшет Apple iPad Pro 128GB",
      newPrice: "59 999",
      availability: "В наличии",
    },
    {
      img: "img/tovar/iphone13.jpg",
      model: "Планшет Apple iPad Pro 128GB",
      newPrice: "59 999",
      availability: "В наличии",
    },
    {
      img: "img/tovar/iphone13.jpg",
      model: "Планшет Apple iPad Pro 128GB",
      newPrice: "1599",
      availability: "В наличии",
    },

    // Добавьте еще товары, чтобы их было, например, 7
  ];

  return (
    <div className="product-list-container">
      <div className="product-list">
        {products.map((product, index) => (
          <ProductCard
            key={index}
            img={product.img}
            model={product.model}
            oldPrice={product.oldPrice}
            newPrice={product.newPrice}
            availability={product.availability}
          />
        ))}
      </div>
    </div>
  );
};

export default ProductList;
